    podesiListuKorisnika((predthodnaListaKorisnika) => { });

    return [...predthodnaListaKorisnika, { ime: korisnicko_Ime, godine: godiste_Korisnika }];

  };

  return (

    <div>

      <DodajKorisnika onDodajKorisnika={dodajKorisnikaHandler} />
